import Item from "../Items/Item"

export default function Booklist(props){
    let list = props.data
    return(
        <div>
            <ul>
                {
                    (Array.isArray(list))?
                        list.map((element)=>
                            <Item key= {element.id}>{element.bookname}</Item>
                        )
                    :
                        <div>Not a list</div>
                }
            </ul>


        </div>
    )
}
